import React from "react";
import SingleMessage from "./SingleMessage"; 

// Assuming each message has a unique identifier field named 'id'
// SingleMessage component remains the same

export default function Messages({ messages, currentMember }) {
	return (
	  <ul className="messages-list">
		{messages.map((m) => (
		  <SingleMessage key={m.id} message={m} currentMember={currentMember} />
		))}
	  </ul>
	);
  }
